import BurgerConstructor from "../burger-constructor/burger-constructor";

function App(props) {
    return (
        <div className={styles.app}>
            <AppHeader/>
            <div className={styles.builderArea}>
                <BurgerIngredients/>
                <BurgerConstructor />
            </div>
        </div>
    );
}

export default App;
